import React from 'react'
import { Link } from 'react-router-dom'
function Choice() {
  return (
    <div>
     <Link to="/volunteer" className="btn btn-dark">We Need Volunteers</Link>
      <button type="button" class="btn btn-dark">I Will Volunteer</button>
    </div>
  )
}

export default Choice
